  const navigate = useNavigate();
  function serverData() {
    // console.log("sever method test");
    add({
      ContactNo: "7755652598",
      Address: "Nit road silchar",
      CountPeople: "15",
    });
  }

  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <Card style={{ width: "30rem" }}>
          <Alert>
            <Alert.Heading className="d-flex justify-content-center">
              RESCUE FORM VICTIMS
            </Alert.Heading>
            <div className="d-flex justify-content-end pt-3">
              Victim Id:1212
            </div>
          </Alert>
          <Form className="mt-1 p-3">
            <Form.Group className="mb-3">
              <Form.Label>Contact No.:</Form.Label>
              <Form.Control type="number" placeholder="Enter Contact Number"  />
            </Form.Group>

            <Form.Group className="mb-3">
              <Form.Label>Current Address:</Form.Label>
              <Form.Control type="text" placeholder="Enter Your Address" />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Count of People:</Form.Label>
              <Form.Control type="number" placeholder="Enter Count in Number" />
            </Form.Group>
            <div className="d-flex justify-content-center">
              <Button
                onClick={(e) => {
                  navigate("/RequestSlip");
                  e.preventDefault();
                  serverData();
                }}
                variant="primary"
                type="submit"
              >
                Submit
              </Button>
            </div>
          </Form>
        </Card>
      </div>
    </>
  );
}

export default RescueForm;
